import React, { Component } from 'react';
import {
    Grid,
    Typography,
    Box,
    FormControl,
    TextField
} from "@material-ui/core"; 

const Contact = () => {
    return (
        <Grid container direction="column" justify="center" alignItems="center">
            <Grid item xs={12}>
                <Box mb={2}>
                    <Typography variant="h2">Contact</Typography>
                </Box>
            </Grid>
            <Grid item xs={12}>
                <FormControl>
                    <InputLabel htmlFor="name">Your name</InputLabel>
                    <Input id="name" aria-describedby="Your name" />
                    <InputLabel htmlFor="email">Your email</InputLabel>
                    <Input id="email" aria-describedby="Your email address" />
                    <InputLabel htmlFor="message">Your name</InputLabel>
                    <TextField id="message" aria-describedby="Your name" />
                </FormControl>
            </Grid>
        </Grid>
    );
}

export default Contact;
